Okay, here's a computational model for the ultimatum game, focusing on responder behavior and addressing the identified limitations of previous attempts. The model incorporates fairness, loss aversion, amount sensitivity, trial context, and a status quo bias. It targets improved parameter recovery, especially for fairness sensitivity (alpha), and aims for a lower BIC.

**Step-by-step reasoning:**

1.  **Fairness:** I'll model fairness as a combination of the proportional split and a context-dependent adjustment based on `trial_type`. This allows for situations where fairness perception deviates from a strict proportional split.

2.  **Loss Aversion:** Implement a non-linear (logarithmic) loss aversion to capture diminishing sensitivity to losses.

3.  **Amount Sensitivity:** The parameter beta will capture how much more or less they are likely to accept proportional to the split.

4.  **Trial Context:** The trial_type variable (equal, opponent more, participant more) influences fairness perception.

5.  **Status Quo Bias:** Add a parameter (gamma) to capture the increased likelihood of rejecting offers when the participant contributed more. This addresses a potential bias against unequal splits favoring the opponent.

6.  **Interactions:** Allow `alpha` and `beta` to interact additively with each other. This will hopefully allow a more accurate representation of the utility.

7. **Mathematical form:** I'll use a logit model with temperature 1 to map utility to probability of acceptance.

**Model Specification:**

```
<MODEL>
U = beta * split_self + alpha * (fairness - split_self) + gamma * trial_type + loss_aversion
loss_aversion = -lambda * log(abs(min(0, split_self - fairness)) + 1)
fairness = combined_earning * (token_self / (token_self + token_opp)) + delta * trial_type
P_accept = 1 / (1 + exp(-U))
</MODEL>
```

